  return (
    <div className="period__problems section__padding" id="p&p" >
      <div className="period__problems-image">
        {/* <img src={problems} alt="problems"/> */}
      </div>
      <div className="period__problems-content">
        {/* <h1 className="gradient__text">Common Problems Faced by Girls During Periods</h1> */}
      </div>
    </div>
  )
}

export default Problems
